import React from 'react';
import { connect } from 'react-redux';
import history from '../../history';

import { selectChampion } from '../../actions';

class SearchBar extends React.Component {
  render() {
    const NavigateToChampion = (event, value) => {
      if (value) {
        this.props.selectChampion(value);
        history.push(`/champion/${value.key}`);
      }
    }

    return (
        <nav>
            <div class='nav-wrapper'>
                <form>
                    <div class='input-field'>
                        <input id='championSearchBar' type='search' data-target='dropdown1' required />
                        <label class='label-icon' for='championSearchBar'><i class='material-icons'>search</i></label>
                        <ul id='dropdown1' class='dropdown-content'>
                          <li><a href='#!'>one</a></li>
                          <li><a href='#!'>two</a></li>
                          <li class='divider' tabindex='-1'></li>
                          <li><a href='#!'>three</a></li>
                          <li><a href='#!'><i class='material-icons'>view_module</i>four</a></li>
                          <li><a href='#!'><i class='material-icons'>cloud</i>five</a></li>
                        </ul>
                        <i class='material-icons'>close</i>

                        <ul id = "dropdown" class = "dropdown-content">
                          <li><a href = "#">Inbox<span class = "badge">12</span></a></li>
                          <li><a href = "#!">Unread<span class = "new badge">4</span></a></li>
                          <li><a href = "#">Sent</a></li>
                          <li class = "divider"></li>
                          <li><a href = "#">Outbox<span class = "badge">14</span></a></li>
                        </ul>
                        
                        <a class = "btn dropdown-button" href = "#" data-activates = "dropdown">Mail Box
                          <i class = "mdi-navigation-arrow-drop-down right"></i>
                        </a>	 
                        
                    </div>
                </form>
            </div>
        </nav>
    );
  }
}

const mapStateToProps = (state) => {
    return { champions: state.champions }
  }
  
  export default connect(mapStateToProps, { selectChampion })(SearchBar);
